// Navbar1.propTypes = {
//     title: PropTypes.string.isRequired,}
import Nav from 'react-bootstrap/Nav';

function Navbar1() {
  return (
    <div className="row" style={{width: 1700,}}>
      <div className="col col-md-auto">
        <div className="title">
          Yes!Places
        </div>
      </div>
      <div className="col">
        <div className="navbar">
        <Nav>

          <div>
            <button className="btn-navbar btn-page"> Profile </button>
          </div>

          <div>
            <button className="btn-navbar"> Restaruants </button>
          </div>

          <div>
            <button className="btn-navbar"> Pet Restaruants </button>
          </div>

          <div>
            <button className="btn-navbar"> Hotels </button>
          </div>
      

          <div>
            <button className="btn-navbar"> Recipes </button>
          </div>

          <div>
            <button className="btn-navbar"> About </button>
          </div>
          
        </Nav>
        </div>
      </div>

    </div>
  );
}


export default Navbar1
